import "./ContentContainer.css";
import Content from "./Content";

function ContentContainer() {
  return (
    <section id="contents">
      <div className="content-title-container">
        <div className="content-title font-style">프로젝트</div>
      </div>
      <div className="content-container">
        <Content name="현이홈페이지 제작" year="2020" complete="완료" />
        <Content name="PTPO 프로젝트" year="2021" complete="진행중" />
        <Content name="파이썬 게임" year="2020" complete="완료" />
        <Content name="파이썬 GUI" year="2020" complete="완료" />
        <Content name="MOVIE APP" year="2021" complete="완료" />
        <Content name="toDoList" year="2021" complete="미완료" />
      </div>
    </section>
  );
}

export default ContentContainer;
